import React, { Component } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";
import "./index.css";

class App extends Component {
  render() {
    return (
      <MDBContainer>
        <MDBRow>
          <MDBCol className="red" size="8">One of three columns</MDBCol>
          <MDBCol size="4">One of three columns</MDBCol>
        </MDBRow>
    </MDBContainer>
    );
  }
}

export default App;
